import Vue from 'vue'
import Router from 'vue-router'

import main from "@/modules/core/components/main.vue";
import Page1 from "@/modules/admin/components/Page1.vue";
import Page2 from "@/modules/admin/components/Page2.vue";

Vue.use(Router)

let router = new Router({
    routes: [
        {
            path: '/',
            name: 'mainPage',
            component: main
        },
        {
            path: '/page1',
            name: 'pageOne',
            component: Page1
        },
        {
            path: '/page2',
            name: 'pageTwo',
            component: Page2
        }
    ]
})

export default router
